import Model from './Model';

const showMessage = ({ head, text, ulData }) => ({
  type: Model.SET_MESSAGE_SHOWING,
  value: true,
  head,
  text,
  ulData,
});

const closeMessage = () => ({
  type: Model.SET_MESSAGE_SHOWING,
  value: false,
  head: '',
  text: '',
  ulData: [],
});

export default { showMessage, closeMessage };
